import { Container, Stack, Typography } from "@mui/material";

export default function KYsheetDetails() {
  return (
    <Container maxWidth="95%">
      <Stack spacing={2}>
        <Typography sx={{ width: "20px", height: "20px", borderRadius: "50%" }}>
          1
        </Typography>
        <Typography variant="h5">KY Sheet Details</Typography>
      </Stack>
    </Container>
  );
}
